        .markAnchor({ x: $r('app.float.mark_anchor'), y: CommonConstant.MINIMUM_SIZE })
        .position({ x: CommonConstant.DELETE_POSITION_X, y: CommonConstant.DELETE_POSITION_Y })
        .onClick(() => {
